  const [showModal,setShowModal]=useState(false)
  function handleToggleModal(){
    setShowModal(!showModal)
  }
  return (
    <div className="App">
      <Main handleToggleModal={{handleToggleModal}}/>
    </div>
  );
}

export default App;
